CREATE TABLE flavor (id INTEGER PRIMARY KEY ON CONFLICT REPLACE AUTOINCREMENT NOT NULL, conditionType STRING NOT NULL, operator STRING NOT NULL, factor1 STRING NOT NULL, factor2 STRING NOT NULL, result STRING NOT NULL);
CREATE TABLE league (id INTEGER PRIMARY KEY ON CONFLICT REPLACE AUTOINCREMENT NOT NULL, name STRING NOT NULL, country STRING NOT NULL);
CREATE TABLE team (id INTEGER PRIMARY KEY ON CONFLICT REPLACE AUTOINCREMENT NOT NULL, name STRING NOT NULL, version INTEGER REFERENCES version (id) NOT NULL DEFAULT (1), league INTEGER REFERENCES league (id) NOT NULL, attack INTEGER NOT NULL, midfield INTEGER NOT NULL, defense INTEGER NOT NULL, overall INTEGER NOT NULL, rating STRING (0) NOT NULL, type STRING NOT NULL);
CREATE TABLE version (id INTEGER PRIMARY KEY ON CONFLICT REPLACE AUTOINCREMENT NOT NULL, gameVersion STRING NOT NULL, gameRelease STRING NOT NULL);
